import React from 'react';
import ReactDOM from 'react-dom';
import SiteLogo from '../../assets/Logo/Logo-brainflix.svg'
import UserLogo from '../../assets/Images/Mohan-muruge.jpg'
import './pageNav.scss';

const PageLogo = () => {
    return (
        <img className="nav__logo" src={SiteLogo} alt="site-logo"></img>
    )
}

const PageNavSearchButton = () => {
    return (
        <form className="nav__search" action="search">
            <input className="nav__search-button" type="text" name="search" placeholder="search"/>
        </form>
    )
}

const PageNavUploadButton = () => {
    return (
        <button className="nav__upload"> +UPLOAD </button>
    )
}

const PageNavPhoto = () => {
    return (
        <img className="nav__photo" src={UserLogo} alt="site-logo"></img>
    )
}

const PageNav = () => {
    return (
     <nav className="nav">
         <PageLogo />
         <PageNavSearchButton />
         <PageNavUploadButton />
         <PageNavPhoto />
     </nav>);
}

ReactDOM.render(
    <PageNav />,
    document.getElementById('header')
)
